import { useEffect, useState } from "react";
import { useRef } from "react";

function App() {
  const [data, setData] = useState(null);

  useEffect(()=>{
    fetch('https://api.example.com/data')
    .then(response=>response.json())
    .then(jsonData=>{
      setData(jsonData)
      console.log(jsonData)
    })
  },[data])

  return <div>
    {data}
  </div>
}

export default App;
